import { Outlet, Link } from "react-router-dom";
import Isi_navbar from "./Isi_navbar";

function Navbar_warna() {
  return (
    <>
    <div>
      {/* Navbar */}
      <nav className="main-header navbar navbar-expand-md navbar-dark navbar-black" style={{ background: "linear-gradient(to right, #f00, #00f)" }}>
        <div className="container">
            <Isi_navbar />
        </div>
      </nav>
      {/* /.navbar */}
    </div>
    <Outlet />
    </>
  );
}

export default Navbar_warna;
